export default function Header() {
  return (
    <nav>
      <div className='container'>
        <div className='navbar'>
          <div className='logo'></div>
          <ul className=''></ul>
        </div>
      </div>
      <Link to={'/'}>dd</Link>
    </nav>
  )
}
